Male terminalia.
Apex of ventral median lobe more or less rounded with a very shallow notch and apex of dorsal lobe rounded; ventral lobe longer than dorsal lobe; spined region of internal sac 4.9–5.2 × as long as basal unspined region; spined region divided into 2 sections with an unspined gap between sections: first section bearing dense long simple spines with fairly dense multi-branched spines near sides; second section with sparse simple spines (
Fig. 59a
). Eighth sternite (
Fig. 59b
) strongly obliquely truncate at sides, shallowly emarginate at apex, with long and fairly long setae arising terminally; ventral surface with multi-branched spines and cloud-like processes. Eighth tergite (
Fig. 59c
) emarginate at apex, with dense short simple spines and multi- branched spines on dorsal surface. Paramere 1.75–1.84 × as long as wide, cylindrical in shape; apex rounded with long and short setae (
Fig. 59d
).

Ovipositor and spermatheca.
Ovipositor short; styli arising terminally with short hairs (
Fig. 59e
). Spermatheca heavily curved; spermathecal gland long and arising near base (
Fig. 59f
).

